import React from 'react';
import './MenuBar.css';
import MenuBarItem from './MenuBarItem'
import logo from '../../logo-1.png'

function MenuBar() {
  return (
    <div className="Bar">
      <div className="Left">
        <div className="Logo">
          <p>JTK</p>
          <img src={logo} className="App-logo" alt="logo" />
        </div>
        <MenuBarItem label="Home" />
        <MenuBarItem />
      </div>
      <div className="Right">
        <MenuBarItem />
        <MenuBarItem />
      </div>
    </div>
  );
}

export default MenuBar;
